import useFetch from "./useFetch";

const BlogDetails = () => {
    const { id } = useParams();
    const { data, isPending, error } = useFetch('http://localhost:3000/blogs/' + id);
    return ( 
        <div className="blog-detatils">
            <h2>Blog Details - { id }</h2>
        </div>
     );
}

